import './ExpenseItem.css';

const ExpenseItem = () => {
    return (
        <div className='expense-item'>
            <div>March 28 2021</div>
            <div>
                <div>Car Insurance</div>
                <div>$287.5</div>
            </div>
        </div>
    );
}

export default ExpenseItem;
